use std::collections::HashSet;
use split_expanded_lib::{DeclarationItem};

# [doc = " The underlying kind of a [`MatchError`]."] # [doc = ""] # [doc = " This is a **non-exhaustive** enum. That means new variants may be added in"] # [doc = " a semver-compatible release."] # [non_exhaustive] pub enum MatchErrorKind { # [doc = " An error indicating that an anchored search was requested, but from a"] # [doc = " searcher that was built without anchored support."] InvalidInputAnchored , # [doc = " An error indicating that an unanchored search was requested, but from a"] # [doc = " searcher that was built without unanchored support."] InvalidInputUnanchored , # [doc = " An error indicating that a stream search was attempted on an"] # [doc = " Aho-Corasick automaton with an unsupported `MatchKind`."] UnsupportedStream { # [doc = " The match semantics for the automaton that was used."] got : MatchKind , } , # [doc = " An error indicating that an overlapping search was attempted on an"] # [doc = " Aho-Corasick automaton with an unsupported `MatchKind`."] UnsupportedOverlapping { # [doc = " The match semantics for the automaton that was used."] got : MatchKind , } , # [doc = " An error indicating that the operation requested doesn't support"] # [doc = " automatons that contain an empty pattern string."] UnsupportedEmpty , }